import React from 'react'
import "../Header/header.css"
import { Link } from 'react-router-dom'

const header = () => {
    const navlinks = [
        {
            links: "Login",
            path: "/login",
        },
        {
            links: "Sign Up",
            path: "/signup",
        },
    ]
    return (
        <div>
            <div className='container-fluid'>
                {/* <nav className="navbar-align"> */}

                    <a className="navbar-brand" href="#">BenchmarkYou</a>


                    <div className='nav-it'>
                        <div className="nav-items">
                            {navlinks.map((item) => (
                                <Link
                                    aria-current="page"
                                    to={item.path}
                                    className={getLinkClass(item.path)}
                                >
                                    {item.links}
                                </Link>
                            ))}
                        </div>
                    </div>
                {/* </nav> */}

            </div>
        </div>
    )
}

function getLinkClass(path) {
    // Function to determine class based on the path
    if (path === '/login') {
      return 'log-dec';
    } else if (path === '/signin') {
      return 'sign-dec';
    }
    return '';
  }

export default header
